import React from "react";

const ParoissesBoard = () => {
  return (
    <div className="paroisses-board-container">
      <div className="header">
        <h1>Paroisses</h1>
      </div>

      <div className="paroisses-container">
        <div className="paroisse-add-element">
        <img
          src={process.env.PUBLIC_URL + "/imgs/icons/church.png"}
          alt={"logo"}
        />
        </div>
        <div className="paroisse-element"></div>
      </div>
    </div>
  );
};

export default ParoissesBoard;
